VALUES ('24081665', 'cola de gambón', 'GQ) a 1 swt HC GAMBON CRUDO, SIN CABEZA, PELADO Y DESVENADO. ULTRACONGELADO. INGREDIENTES: Gambón (Pleoticus muelleri), sal y antioxidante (metabisulfito sódico). Puede contener trazas de pescado y moluscos. PREPARACION: No volver a congelar una vez descongelado. Una vez cocinado consumir en menos de 24 horas. Descongelar el producto en el frigorifico (24 horas antes de cocinar) o a temperatura ambiente (2 horas antes de cocinar).El producto debe ser cocinado completamente antes de COnsumir. INFORMACION NUTRICIONAL (Por 100 g): Valor energético: 322 kJ /76 kcal, Grasas: 1,3 g, de las cuales saturadas: 1,0 g, Hidratos de carbono: &lt;0,5 g, de los cuales azúcares: &lt;0,5 g, Proteínas: 16 g, Sal: 0,41 g CAPTURADO EN: 0céano Atlántico Suroeste (FAO 41) ARTE DE PESCA: Redes de arrastre CONSERVACIÓN FABRICADO POR: 7°C - 6°C-12°C 1d 3 dias 1 - 180C***/**** CABOMAR CONGELADOS, S.A.U. Ver fecha de consumo preferente Puerto de Marín, s/n 36900-Marín Pontevedra, España PESO NETO ESCURRIDO: mes NOVOLVER A CONGELAR UNA VEZ DESCONGELADO Y UNA VEZ COCINADO CONSUMIR EN MENOS DE 24 HORAS ES (12.12530/PO CE 1200g', 'https://static.openfoodfacts.org/images/products/24081665/front_es.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

